import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";

// import 'bootstrap/dist/css/bootstrap.min.css';
import "./App.css";
import App from "./App";

// import { BrowserRouter } from "react-router-dom";
import UserProfile from "./Pages/Objek-useState.jsx";
import TextInput from "./Pages/String-useState.jsx";
import Bolean from "./Pages/Bolean-useState.jsx";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <BrowserRouter>
            <UserProfile />
            <TextInput />
            <Bolean />
            <App />
        </BrowserRouter>
    </React.StrictMode>
);
